import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom';

const EstabelecimentoRoutes = () => {
    return <Router>
        <Switch>
            <Route path="/" component={<h1>Painel estabelecimento</h1>} />
        </Switch>
    </Router>
};

export default EstabelecimentoRoutes;
